    if "https://www.mackolik.com/futbolcu/" not in content:
        return liste
    i = content.find("https://www.mackolik.com/futbolcu/")
    content = content[i:]
    j = content.find("\"")
    url = content[:j]
    content = content[j:]
    if url != None:
        liste.append(url)
    return get_urls(content, liste)



